const slicedAsks = asks.slice(1)

const checkSymbolEntriesCount = (list, symbol) => list.filter(({name}) => name === symbol).length < 8 || true

const mergedData = slicedNames.reduce((output, [name, timestamp, splitName=name.split('.')[0]], index) =>
    timestamp && checkSymbolEntriesCount(output, splitName)?
        output.concat({
                name: splitName,
                bid: slicedBids[index],
                ask: slicedAsks[index],
                timestamp: timestamp - Math.round(Math.random() * 86400000 * 20)
            })
        :
        output
, [])

